	private Map<String, String> findBrandFacetIds(List<BrandItem> brandItems) {
		Map<String, String> mapBrandIds = new HashMap<String, String>();
		List<String> listBrandIds = new ArrayList<String>();
		if (!brandItems.isEmpty()) {
			for (BrandItem brandItem : brandItems) {
				mapBrandIds.put(brandItem.getBrandId(), brandItem.getBrandName());
				listBrandIds.add(brandItem.getBrandId());
			}
		}
		Map<String, String> mapBrandFacetIds = prodSpecService.findBrandFacetIdsByBrandIds(listBrandIds);
		return mapBrandFacetIds;
	}

